$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_4bc03ef9c3845dc514752ab561622e82'] = 'Wenn Sie beim Zugriff auf Ihre API-Schlüssel über Ihr Braintree-Konto die Fehlermeldung \"[b]Sie haben nicht die richtige Berechtigung für diese Anforderung[/b]\" erhalten:';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_5ebd3093031cf04578abc79618f473ff'] = '[b]Ihr Konto wurde bereits konfiguriert:[/b]';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_d137f37fc8a46818c15c2bccc8d727db'] = '-Sie können Ihre API-Schlüssel verwenden, wenn Sie sie zuvor gespeichert haben, und weiterhin Zahlungen über Braintree akzeptieren, wenn Ihr Konto bereits korrekt konfiguriert ist. Keine Aktionen auf Ihrer Seite erforderlich.';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_f47003b97fae0faa5ba397559d48d202'] = '[b]Sie möchten Ihre Kontokonfigurationen ändern, können jedoch Ihre API-Schlüssel nicht erhalten:[/b]';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_f237d0ecec61e571ff21e296c183f44a'] = '- Wenn Sie Ihre API-Schlüssel nicht irgendwo auf Ihrer Seite gespeichert haben, können Sie Ihre API-Anmeldeinformationen für das aktuelle Konto nicht mehr verwenden, da wir sie nicht für Sie bereitstellen können. Wenn Sie Ihr aktuelles PrestaShop Braintree-Modul, für das API-Schlüssel erforderlich sind, weiterhin verwenden möchten, müssen Sie ein Braintree Direct-Konto beantragen, indem Sie unten auf der Braintree-Homepage auf die Schaltfläche „Anmelden“ klicken. Sobald Sie für das neue Konto genehmigt wurden, können Sie sich anmelden und Ihre API-Schlüssel abrufen. Wenn Sie Probleme mit dem Genehmigungsprozess von Braintree haben, wenden Sie sich bitte an den Braintree-Support auf dessen Website.';
